import React, { Component } from "react";
import Layout from "../components/Layout";
import Skill from "../containers/Skill";
import ProjectsPage from "../containers/Projects";



class Index extends Component {



    render() {
        return (
            <div>
                <Layout>
                    <div className="view intro-2 wheat bg-header">
                        <div className="full-bg-img">
                            <div className="mask rgba-black-strong flex-center">
                                <div className="container">
                                    <div className=" text-center wow fadeInUp">
                                    <   p className="lead wheat mt-5">Hello, My Name Is</p>
                                        <h1 className="display-4 ">Phanat Buaban</h1>
                                        <br></br>
                                        <h5>Anytime you want</h5>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div>
                        <Skill />
                        <ProjectsPage />
                    </div>
                </Layout>
            </div>
        )
    }
}


export default Index;
